DROP TABLE IF EXISTS `migrations`;
CREATE TABLE `migrations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `timestamp` bigint(20) NOT NULL,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `Pokemons`;
CREATE TABLE `Pokemons` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `image` varchar(255) NOT NULL,
  `small_image` varchar(255) NOT NULL,
  `generation` varchar(255) DEFAULT '0',
  `evolution_stage` varchar(255) DEFAULT '0',
  `evolved` varchar(255) DEFAULT '0',
  `family_id` varchar(255) DEFAULT '0',
  `cross_gen` varchar(255) DEFAULT '0',
  `stat_total` varchar(255) DEFAULT '0',
  `atk` varchar(255) DEFAULT '0',
  `def` varchar(255) DEFAULT '0',
  `sta` varchar(255) DEFAULT '0',
  `legendary` varchar(255) DEFAULT '0',
  `aquireable` varchar(255) DEFAULT '0',
  `spawns` varchar(255) DEFAULT '0',
  `regional` varchar(255) DEFAULT '0',
  `raidable` varchar(255) DEFAULT '0',
  `hatchable` varchar(255) DEFAULT '0',
  `shiny` varchar(255) DEFAULT '0',
  `nest` varchar(255) DEFAULT '0',
  `is_new` varchar(255) DEFAULT '0',
  `not_gettable` varchar(255) DEFAULT '0',
  `future_evolve` varchar(255) DEFAULT '0',
  `n_100_cp_40` varchar(255) DEFAULT '0',
  `n_100_cp_39` varchar(255) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=802 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `Types`;
CREATE TABLE `Types` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `Users`;
CREATE TABLE `Users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UQ_97672ac88f789774dd47f7c8be3` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `Weathers`;
CREATE TABLE `Weathers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `pokemons_types`;
CREATE TABLE `pokemons_types` (
  `pokemon_id` int(11) NOT NULL,
  `type_id` int(11) NOT NULL,
  PRIMARY KEY (`pokemon_id`,`type_id`),
  KEY `fk_types` (`type_id`),
  CONSTRAINT `fk_pokemons` FOREIGN KEY (`pokemon_id`) REFERENCES `Pokemons` (`id`),
  CONSTRAINT `fk_types` FOREIGN KEY (`type_id`) REFERENCES `Types` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `pokemons_weathers`;
CREATE TABLE `pokemons_weathers` (
  `pokemon_id` int(11) NOT NULL,
  `weather_id` int(11) NOT NULL,
  PRIMARY KEY (`pokemon_id`,`weather_id`),
  KEY `fk_weathers` (`weather_id`),
  CONSTRAINT `fk_pokemons_w` FOREIGN KEY (`pokemon_id`) REFERENCES `Pokemons` (`id`),
  CONSTRAINT `fk_weathers` FOREIGN KEY (`weather_id`) REFERENCES `Weathers` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;










